import Link from 'next/link';

const Index = ({ location }) => {
  console.log(location.history);
  return (
    <div>
      <Link href='/'>
        <a>Main Page</a>
      </Link>
      <Link href='/about'>
        <a>About Page</a>
      </Link>
      Main Page
    </div>
  );
};

export default Index;
